import React from 'react';
import './ReportIncident.css';

const ReportIncident = () => {
  return (
    <div className="report-incident">
      <h2>Select Incident Type</h2>
      <p>[Radio Buttons: Potholes, Broken Streetlights, Garbage]</p>
      <textarea placeholder="Describe the incident..."></textarea>
      <input type="text" placeholder="Enter location manually" />
      <button>Submit</button>
    </div>
  );
};

export default ReportIncident;
